static const char __pyx_k_Represents_an_period_of_time_Pa[] = "\n    Represents an period of time\n\n    Parameters\n    ----------\n    value : Period or compat.string_types, default None\n        The time period represented (e.g., '4Q2005')\n    freq : str, default None\n        One of pandas period strings or corresponding objects\n    year : int, default None\n    month : int, default 1\n    quarter : int, default None\n    day : int, default 1\n    hour : int, default 0\n    minute : int, default 0\n    second : int, default 0\n    ";
static const char __pyx_k_Returns_the_string_representati[] = "\n        Returns the string representation of the :class:`Period`, depending\n        on the selected :keyword:`format`. :keyword:`format` must be a string\n        containing one or several directives.  The method recognizes the same\n        directives as the :func:`time.strftime` function of the standard Python\n        distribution, as well as the specific additional directives ``%f``,\n        ``%F``, ``%q``. (formatting & docs originally from scikits.timeries)\n\n        +-----------+--------------------------------+-------+\n        | Directive | Meaning                        | Notes |\n        +===========+================================+=======+\n        | ``%a``    | Locale's abbreviated weekday   |       |\n        |           | name.                          |       |\n        +-----------+--------------------------------+-------+\n        | ``%A``    | Locale's full weekday name.    |       |\n        +-----------+--------------------------------+-------+\n        | ``%b``    | Locale's abbreviated month     |       |\n        |           | name.                          |       |\n        +-----------+--------------------------------+-------+\n        | ``%B``    | Locale's full month name.      |       |\n        +-----------+--------------------------------+-------+\n        | ``%c``    | Locale's appropriate date and  |       |\n        |           | time representation.           |       |\n        +-----------+--------------------------------+-------+\n        | ``%d``    | Day of the month as a decimal  |       |\n        |           | number [01,31].                |       |\n        +-----------+--------------------------------+-------+\n        | ``%f``    | 'Fiscal' year without a        | \\(1)  |\n        |           | century  as a decimal number   |       |\n        |           | [00,99]                        |       |\n        +-----------+--------------------------------+-------+\n        | ``%F``    | 'Fiscal' year with a century  "" | \\(2)  |\n        |           | as a decimal number            |       |\n        +-----------+--------------------------------+-------+\n        | ``%H``    | Hour (24-hour clock) as a      |       |\n        |           | decimal number [00,23].        |       |\n        +-----------+--------------------------------+-------+\n        | ``%I``    | Hour (12-hour clock) as a      |       |\n        |           | decimal number [01,12].        |       |\n        +-----------+--------------------------------+-------+\n        | ``%j``    | Day of the year as a decimal   |       |\n        |           | number [001,366].              |       |\n        +-----------+--------------------------------+-------+\n        | ``%m``    | Month as a decimal number      |       |\n        |           | [01,12].                       |       |\n        +-----------+--------------------------------+-------+\n        | ``%M``    | Minute as a decimal number     |       |\n        |           | [00,59].                       |       |\n        +-----------+--------------------------------+-------+\n        | ``%p``    | Locale's equivalent of either  | \\(3)  |\n        |           | AM or PM.                      |       |\n        +-----------+--------------------------------+-------+\n        | ``%q``    | Quarter as a decimal number    |       |\n        |           | [01,04]                        |       |\n        +-----------+--------------------------------+-------+\n        | ``%S``    | Second as a decimal number     | \\(4)  |\n        |           | [00,61].                       |       |\n        +-----------+--------------------------------+-------+\n        | ``%U``    | Week number of the year        | \\(5)  |\n        |           | (Sunday as the first day of    |       |\n        |           | the week) as a decimal number  |       |\n        |           | [00,53].  All days in a new    |       |\n        |           | year preceding the first       |       |""\n        |           | Sunday are considered to be in |       |\n        |           | week 0.                        |       |\n        +-----------+--------------------------------+-------+\n        | ``%w``    | Weekday as a decimal number    |       |\n        |           | [0(Sunday),6].                 |       |\n        +-----------+--------------------------------+-------+\n        | ``%W``    | Week number of the year        | \\(5)  |\n        |           | (Monday as the first day of    |       |\n        |           | the week) as a decimal number  |       |\n        |           | [00,53].  All days in a new    |       |\n        |           | year preceding the first       |       |\n        |           | Monday are considered to be in |       |\n        |           | week 0.                        |       |\n        +-----------+--------------------------------+-------+\n        | ``%x``    | Locale's appropriate date      |       |\n        |           | representation.                |       |\n        +-----------+--------------------------------+-------+\n        | ``%X``    | Locale's appropriate time      |       |\n        |           | representation.                |       |\n        +-----------+--------------------------------+-------+\n        | ``%y``    | Year without century as a      |       |\n        |           | decimal number [00,99].        |       |\n        +-----------+--------------------------------+-------+\n        | ``%Y``    | Year with century as a decimal |       |\n        |           | number.                        |       |\n        +-----------+--------------------------------+-------+\n        | ``%Z``    | Time zone name (no characters  |       |\n        |           | if no time zone exists).       |       |\n        +-----------+--------------------------------+-------+\n        | ``%%``    | A literal ``'%'`` character.   |       |\n        +-----------+--------------------------------+-------+\n\n        .. ""note::\n\n            (1)\n                The ``%f`` directive is the same as ``%y`` if the frequency is\n                not quarterly.\n                Otherwise, it corresponds to the 'fiscal' year, as defined by\n                the :attr:`qyear` attribute.\n\n            (2)\n                The ``%F`` directive is the same as ``%Y`` if the frequency is\n                not quarterly.\n                Otherwise, it corresponds to the 'fiscal' year, as defined by\n                the :attr:`qyear` attribute.\n\n            (3)\n                The ``%p`` directive only affects the output hour field\n                if the ``%I`` directive is used to parse the hour.\n\n            (4)\n                The range really is ``0`` to ``61``; this accounts for leap\n                seconds and the (very rare) double leap seconds.\n\n            (5)\n                The ``%U`` and ``%W`` directives are only used in calculations\n                when the day of the week and the year are specified.\n\n        .. rubric::  Examples\n\n            >>> a = Period(freq='Q@JUL', year=2006, quarter=1)\n            >>> a.strftime('%F-Q%q')\n            '2006-Q1'\n            >>> # Output the last month in the quarter of this date\n            >>> a.strftime('%b-%Y')\n            'Oct-2005'\n            >>>\n            >>> a = Period(freq='D', year=2001, month=1, day=1)\n            >>> a.strftime('%d-%b-%Y')\n            '01-Jan-2006'\n            >>> a.strftime('%b. %d, %Y was a %A')\n            'Jan. 01, 2001 was a Monday'\n        ";
